export default function Question(props) {
	console.log(props)
	return (
		<div>
			<h1>{props.question}</h1>
			<h2>{props.category}</h2>
			<h3>{props.correct_answer}</h3>
			<h4>{props.incorrect_answers}</h4>

		</div>
	)
}
